import React from 'react';
import Card from './Card';

const TrackerInfo = [
   {
      id: '1234',
      name: 'Task 1',
      start: '',
      end: ''
   },
   {
      id: '1235',
      name: 'Task 2',
      start: '',
      end: ''
   },
   {
      id: '1236',
      name: 'Task 3',
      start: '',
      end: ''
   },
   {
      id: '1237',
      name: 'Task 4',
      start: '',
      end: ''
   },
]

const Home = () => (
   <div>
      {TrackerInfo.map( (info) => (
         <Card data={info}/>
      ))}
   </div>
)

export default Home;
